import React from "react";
import { MenuItems } from "./MenuItems";

export default function NavBar() {
    let footerStyle = {
        position: "relative",
        // top: '15rem',
        display: 'flex',
        background: "red",
        margin: '0',
        top: "0",
        width: "100%"
    }
    return (
        <nav  className="NavbarItems" >
                <h1 className="navbar-logo">GS:GrihSangini</h1>
                <div className="menu-icon"></div>
                <ul>
                    {MenuItems.map((item , index) => {
                        return (
                            <li><a className={item.name} href={item.link}>Hello</a></li>
                        )
                    })}
                </ul>
        </nav>
    )
}
